import React, { Component } from 'react'
// import Dialog from './components/Dialog'
import {Route, Switch, Redirect} from 'react-router-dom'
import About from './pages/About'
import Home from './pages/Home'
import MyNavLink from './components/MyNavLink'

import 'bootstrap/dist/css/bootstrap.min.css'

export default class App extends Component {
  render() {
    return (

        <div className={['container', "App"].join(' ')}>
          {/* {<Dialog />} */}
          {/* 在原生Html中，靠<a>跳转不同的页面 */}

          {/* 在React中，靠路由链接实现切换组件 */}
          {/* 靠link切换没有样式 */}
            {/* <Link to='/about'>About</Link>
            <Link to='/home'>Home</Link> */}

          {/* <div>
            <NavLink className='btn' to='/about' activeClassName='btn-success'>About</NavLink>
            <NavLink className='btn' to='/home' activeClassName='btn-danger'>Home</NavLink>
          </div> */}

          <MyNavLink to='/about' children='about'>myAbout</MyNavLink>
          <MyNavLink to='/home'>home</MyNavLink>

          {/* 路径 */}
          <Switch>
            <Route path='/about' component={About}></Route>
            <Route path='/home' component={Home}></Route>
            <Redirect to='/about'></Redirect>
          </Switch>
        </div>
    )
  }
}
